function Home() {
  const [game, setGame] = useState([]);
  function getPuroosso(){
    axios.get("http://localhost:3010/game").then(
      response => {
        setGame(response.data.data)
      }
    )
  }
  useEffect(function(){
    getPuroosso()
  }, [])
  return (
    <div className="home">
      {/* <Subheader/> */}
      <Modalidades />
      {game.map(g => <p>{g}</p>)}
      {/* {dboperations} */}
      {/* <Numbers numbers={numbers} setNumbers={setNumbers} />
      <Pacotes numbers={numbers} /> */}
    </div>
  );
}

export default Home;
